  ["|cff33ffccBlizzard: \"Interface Options\"|r\n\nDo you want me to set up the recommended Blizzard UI settings? This will enable settings that can be found in the Interface section of your client. Options like Buff Durations, Instant Quest Text, Auto Selfcast and others will be set."] = "|cff33ffcc暴雪: \"介面選項\"|r\n\n你要我安裝暴雪UI設置建議？ 啟用此設置可以在用戶端的介面部分找到。 像buff持續時間選項，即時任務文本，自動施法和其他功能將被設置。",
  ["|cff33ffccChat: \"Channels\"|r\n\nDo you want me to setup the chat channels of your chatframes? This would set important or personal messages to the left chat and world channels and lootinformation to the right chat."] = "|cff33ffcc聊天框架: \"聊天頻道\"|r\n\n你想建立聊天框架中新的聊天頻道？ 這將設置重要或個人資訊到左側聊天。 和世界頻道和資訊到正確的聊天視窗。",
  ["|cff33ffccChat: \"Layout\"|r\n\nDo you want me to adjust the layout of your chatframes? This would make sure, that every window is placed on its dedicated position."] = "|cff33ffcc聊天框架: \"聊天視窗佈局\"|r\n\n你要我調整聊天框架的佈局嗎？ 這將確保每個視窗都放在其專用位置上。",
  ["|cff33ffccChat: \"Loot & Spam\"|r\n\nDo you want me to create and manage a specific Chatframe called \"Loot & Spam\"? This chat will display world channels, loot information and miscellaneous messages, that would otherwise clutter your main chatframe."] = "|cff33ffcc聊天框架: \"룻팅 & 스팜\"|r\n\n您是否希望我創建和管理名為\"Loot & Spam\"的特定聊天框架？ 此聊天將顯示世界頻道、戰利品資訊和雜項消息， 否則會干擾您的主要聊天框。",
  ["|cff33ffccKeybind Mode|r\nThis mode allows you to bind keyboard shortcuts to your actionbars.\nBy hovering a button with your cursor and pressing a key, the key will be assigned to that button.\nHit Escape on a button to remove bindings.\n\nPress Escape or click on an empty area to leave the keybind mode."] = "|cff33ffcc熱鍵綁定模式|r\n這個模式允許你綁定鍵盤快速鍵到你的動作條。\n通過用滑鼠懸停一個按鈕並按下一個鍵，快速鍵將被分配到該按鈕。\n在按鈕上按Esc鍵可以刪除綁定。\n\n按Esc鍵或按一下空白區域離開熱鍵綁定模式。",
